// Mock inflation data for different countries
export const inflationData = {
  Indonesia: {
    currency: 'IDR',
    currencySymbol: 'Rp',
    data: [
      { year: 2018, rate: 3.13 },
      { year: 2019, rate: 2.72 },
      { year: 2020, rate: 1.68 },
      { year: 2021, rate: 1.87 },
      { year: 2022, rate: 4.21 },
      { year: 2023, rate: 3.61 },
      { year: 2024, rate: 2.84 },
      { year: 2025, rate: 2.95 }
    ]
  },
  'United States': {
    currency: 'USD',
    currencySymbol: '$',
    data: [
      { year: 2018, rate: 2.44 },
      { year: 2019, rate: 1.81 },
      { year: 2020, rate: 1.23 },
      { year: 2021, rate: 4.70 },
      { year: 2022, rate: 8.00 },
      { year: 2023, rate: 4.12 },
      { year: 2024, rate: 3.18 },
      { year: 2025, rate: 2.85 }
    ]
  },
  'United Kingdom': {
    currency: 'GBP',
    currencySymbol: '£',
    data: [
      { year: 2018, rate: 2.48 },
      { year: 2019, rate: 1.74 },
      { year: 2020, rate: 0.99 },
      { year: 2021, rate: 2.59 },
      { year: 2022, rate: 9.12 },
      { year: 2023, rate: 7.31 },
      { year: 2024, rate: 2.97 }
    ]
  },
  Japan: {
    currency: 'JPY',
    currencySymbol: '¥',
    data: [
      { year: 2018, rate: 0.98 },
      { year: 2019, rate: 0.48 },
      { year: 2020, rate: 0.00 },
      { year: 2021, rate: -0.25 },
      { year: 2022, rate: 2.50 },
      { year: 2023, rate: 3.27 },
      { year: 2024, rate: 2.76 }
    ]
  },
  Germany: {
    currency: 'EUR',
    currencySymbol: '€',
    data: [
      { year: 2018, rate: 1.78 },
      { year: 2019, rate: 1.38 },
      { year: 2020, rate: 0.37 },
      { year: 2021, rate: 3.14 },
      { year: 2022, rate: 6.87 },
      { year: 2023, rate: 5.89 },
      { year: 2024, rate: 2.24 }
    ]
  }
};

export const countries = Object.keys(inflationData);

export const currencyRates = {
  IDR: 1,
  USD: 0.000067,
  GBP: 0.000053,
